import React from 'react';

function Main() {
    const products = [
        { id: 1, name: "Товар 1", price: "100 руб." },
        { id: 2, name: "Товар 2", price: "200 руб." },
        { id: 3, name: "Товар 3", price: "300 руб." }
    ];

    return (
        <main>
            <section className="container">
                <div className="wrapper">
                    <div className="products">
                        {products.map(product => (
                            <div key={product.id} className="card">
                                <h3>{product.name}</h3>
                                <p>{product.price}</p>
                            </div>
                        ))}
                    </div>
                </div>
            </section>
        </main>
    );
}

export default Main;
